import styled from "styled-components";
import { Centralize } from "../Components/Centralize/Centralize";
export const Container = styled.div`
    position: relative;
    overflow: auto;
    background-color: var(--e62);
    height: 100%;
`;
export const Wrapper = styled(Centralize)`
    display: flex;

`;
